import React from 'react';
import { Navbar, NavItem } from 'react-materialize';
export default class Home extends React.Component{
    render(){
     return(
         <div>
          <Navbar brand={<a />} alignLinks="right">
            <NavItem href="/About">
            About
            </NavItem>
            <NavItem href="/Projects">
            Projects
            </NavItem>

            </Navbar>
         </div> 
     )
    }
}
